import React, { useState } from 'react';

const SurgeryForm = () => {
  // State for each form field
  const [date_Procedure, setDate_Procedure] = useState('');
  const [postOpDay, setPostOpDay] = useState('');
  const [purulentDischarge, setPurulentDischarge] = useState('');
  const [localizedPain, setLocalizedPain] = useState('');
  const [localizedSwelling, setLocalizedSwelling] = useState('');
  const [fever, setFever] = useState('');
  const [incisionDeliberatelyOpened, setIncisionDeliberatelyOpened] = useState('');
  const [spontaneousDehiscence, setSpontaneousDehiscence] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log({
      date_Procedure,
      postOpDay,
      purulentDischarge,
      localizedPain,
      localizedSwelling,
      fever,
      incisionDeliberatelyOpened,
      spontaneousDehiscence,
    });
  };

  return (
    <div style={{
      width: '50%',
      margin: '0 auto',
      backgroundColor: '#f4f4f4',
      padding: '20px',
      borderRadius: '8px',
      boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)'
    }}>
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column' }}>
        <h2>Surgery Procedure Form</h2>

        {/* Date of Procedure */}
        <label htmlFor="date_Procedure" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Date of Procedure:</label>
        <input
          type="date"
          id="date_Procedure"
          name="date_Procedure"
          value={date_Procedure}
          onChange={(e) => setDate_Procedure(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Post Op Day */}
        <label htmlFor="postOpDay" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Post Op Day:</label>
        <input
          type="number"
          id="postOpDay"
          name="postOpDay"
          value={postOpDay}
          onChange={(e) => setPostOpDay(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Purulent Discharge */}
        <label htmlFor="purulentDischarge" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Purulent Discharge:</label>
        <input
          type="text"
          id="purulentDischarge"
          name="purulentDischarge"
          value={purulentDischarge}
          onChange={(e) => setPurulentDischarge(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Localized Pain */}
        <label htmlFor="localizedPain" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Localized Pain:</label>
        <input
          type="text"
          id="localizedPain"
          name="localizedPain"
          value={localizedPain}
          onChange={(e) => setLocalizedPain(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Localized Swelling */}
        <label htmlFor="localizedSwelling" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Localized Swelling:</label>
        <input
          type="text"
          id="localizedSwelling"
          name="localizedSwelling"
          value={localizedSwelling}
          onChange={(e) => setLocalizedSwelling(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Fever */}
        <label htmlFor="fever" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Fever:</label>
        <input
          type="text"
          id="fever"
          name="fever"
          value={fever}
          onChange={(e) => setFever(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Incision Deliberately Opened */}
        <label htmlFor="incisionDeliberatelyOpened" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Incision Deliberately Opened:</label>
        <input
          type="text"
          id="incisionDeliberatelyOpened"
          name="incisionDeliberatelyOpened"
          value={incisionDeliberatelyOpened}
          onChange={(e) => setIncisionDeliberatelyOpened(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        {/* Spontaneous Dehiscence */}
        <label htmlFor="spontaneousDehiscence" style={{ marginBottom: '8px', fontWeight: 'bold' }}>Spontaneous Dehiscence:</label>
        <input
          type="text"
          id="spontaneousDehiscence"
          name="spontaneousDehiscence"
          value={spontaneousDehiscence}
          onChange={(e) => setSpontaneousDehiscence(e.target.value)}
          style={{
            padding: '8px',
            marginBottom: '15px',
            border: '1px solid #ccc',
            borderRadius: '4px'
          }}
        />

        <button type="submit" style={{
          padding: '10px 15px',
          backgroundColor: '#28a745',
          color: 'white',
          border: 'none',
          borderRadius: '4px',
          cursor: 'pointer'
        }}>
          Submit
        </button>
      </form>
    </div>
  );
};

export default SurgeryForm;
